                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                 cos(m_q1)*cos(m_q4) - sin(m_q4)*(cos(m_q2 - 6065431435497449/4503599627370496)*cos(m_q3 + 51326832763773/17592186044416)*sin(m_q1) - sin(m_q2 - 6065431435497449/4503599627370496)*sin(m_q3 + 51326832763773/17592186044416)*sin(m_q1)),                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                   - sin(m_q5 - pi/2)*(cos(m_q1)*sin(m_q4) + cos(m_q4)*(cos(m_q2 - 6065431435497449/4503599627370496)*cos(m_q3 + 51326832763773/17592186044416)*sin(m_q1) - sin(m_q2 - 6065431435497449/4503599627370496)*sin(m_q3 + 51326832763773/17592186044416)*sin(m_q1))) - cos(m_q5 - pi/2)*(cos(m_q2 - 6065431435497449/4503599627370496)*sin(m_q3 + 51326832763773/17592186044416)*sin(m_q1) + sin(m_q2 - 6065431435497449/4503599627370496)*cos(m_q3 + 51326832763773/17592186044416)*sin(m_q1))];
%     Jaco6 = [                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                  1,                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                   0,                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                     0,                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                 cos(m_q2 - 6065431435497449/4503599627370496)*cos(m_q3 + 51326832763773/17592186044416) - sin(m_q2 - 6065431435497449/4503599627370496)*sin(m_q3 + 51326832763773/17592186044416),                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                         sin(m_q4)*(cos(m_q2 - 6065431435497449/4503599627370496)*sin(m_q3 + 51326832763773/17592186044416) + sin(m_q2 - 6065431435497449/4503599627370496)*cos(m_q3 + 51326832763773/17592186044416)),                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                     cos(m_q4)*sin(m_q5 - pi/2)*(cos(m_q2 - 6065431435497449/4503599627370496)*sin(m_q3 + 51326832763773/17592186044416) + sin(m_q2 - 6065431435497449/4503599627370496)*cos(m_q3 + 51326832763773/17592186044416)) - cos(m_q5 - pi/2)*(cos(m_q2 - 6065431435497449/4503599627370496)*cos(m_q3 + 51326832763773/17592186044416) - sin(m_q2 - 6065431435497449/4503599627370496)*sin(m_q3 + 51326832763773/17592186044416))];
    Jacobian = [Jaco1; Jaco2; Jaco3; Jaco4; Jaco5; Jaco6;];

